// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract loops_conditionals {
    function loop_and_conditional() public pure returns (uint) {
        uint counter = 1;
        uint _sum = 1;
        while(counter < 15){
            counter++;
            if(counter % 2 == 1){
                _sum += counter;
            }
        }
        return _sum;
    }

    function fsum(uint _numer) public pure returns (uint) {
        uint aux_sum = 0;

        for(uint i = _numer; i < (10 + _numer); i++) {
            aux_sum += i;
        }

        return aux_sum;
    }
}

